import React from 'react';
import Sidebar from './components/Sidebar';

function App() {
  return (
    <div className="app">
      <div className="container">
        <div className="row">
          <div className="col-lg-3 ">
              <Sidebar />
          </div>
          <div className="col-lg-9 app_mainComponent">
            MainComponent
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
